#! /usr/bin/env python
"""Rook check chess kata submission.

Minimal representation of a chess position with only kings and rooks,
"""

from collections import deque
from enum import Enum
from dataclasses import dataclass, field
from functools import lru_cache
from typing import Callable, NewType, Tuple, List, Dict, Deque, Optional, Union
import random
import base64
import zlib


U64 = NewType("U64", int)
U64_MASK = (1 << 64) - 1  # 0xFFFFFFFFFFFFFFFF


def set_bit(bb: U64, sq64: int) -> U64:
    return to_u64(int(bb) | (1 << sq64))


def clear_bit(bb: U64, sq64: int) -> U64:
    return to_u64(int(bb) & ~(1 << sq64))


def _empty_piece_bitboards() -> List[List[U64]]:
    return [
        [U64(0), U64(0)],
        [U64(0), U64(0)],
    ]


FILE_A = 0x0101010101010101
FILE_H = 0x8080808080808080
NOT_FILE_A = U64(~FILE_A & U64_MASK)
NOT_FILE_H = U64(~FILE_H & U64_MASK)

FILES = "abcdefgh"
BRD_SQ_NUM = 64
TABLEBASE_REPEAT_THRESHOLD = 3
TABLEBASE_TRACKER_MAX = 8_192

FILE_INDEX: Tuple[int, ...] = tuple(sq % 8 for sq in range(BRD_SQ_NUM))
RANK_INDEX: Tuple[int, ...] = tuple(sq // 8 for sq in range(BRD_SQ_NUM))


_KRK_PACKED_B64 = """

""".strip()

_KRK_DTM_B64 = """

""".strip()


def iter_bits(mask: int):
    while mask:
        lsb = mask & -mask
        idx = lsb.bit_length() - 1
        yield idx
        mask ^= lsb


class Color(Enum):
    white = 0
    black = 1
    both = 2


class Pcs(Enum):
    empty = 0
    R = 1
    K = 2
    r = 3
    k = 4


WHITE_PIECES = (Pcs.R, Pcs.K)
BLACK_PIECES = (Pcs.r, Pcs.k)

ROOK_SLOT = 0
KING_SLOT = 1
PIECE_SLOT = {
    Pcs.R: ROOK_SLOT,
    Pcs.K: KING_SLOT,
    Pcs.r: ROOK_SLOT,
    Pcs.k: KING_SLOT,
}


WHITE_INDEX = Color.white.value
BLACK_INDEX = Color.black.value
BOTH_INDEX = Color.both.value


def _load_krk_dtm() -> bytearray:
    if not _KRK_DTM_B64:
        return bytearray()
    return bytearray(zlib.decompress(base64.b64decode(_KRK_DTM_B64)))


def _krk_load_packed() -> bytearray:
    if not _KRK_PACKED_B64:
        return bytearray()
    compressed = base64.b64decode(_KRK_PACKED_B64)
    data = zlib.decompress(compressed)
    return bytearray(data)


_KRK_DTM = _load_krk_dtm()
_KRK_TABLE = _krk_load_packed()


def _krk_unpack(entry_byte: int) -> tuple[int, int, int]:
    return ((entry_byte >> 6) & 0b11, (entry_byte >> 4) & 0b11, entry_byte & 0b111111)


def _white_rook_sq(board) -> int:
    bb = int(board.pieces_bb[WHITE_INDEX][ROOK_SLOT])
    return (bb & -bb).bit_length() - 1 if bb else -1


def _krk_index(side: Color, wk: int, wr: int, bk: int) -> int:
    return (side.value << 18) | (wk << 12) | (wr << 6) | bk


def _is_valid_krk_position(board) -> bool:
    wr_bb = int(board.pieces_bb[WHITE_INDEX][ROOK_SLOT])
    br_bb = int(board.pieces_bb[BLACK_INDEX][ROOK_SLOT])
    if wr_bb.bit_count() != 1 or br_bb != 0:
        return False
    wk = board.kings_pos[WHITE_INDEX]
    bk = board.kings_pos[BLACK_INDEX]
    return wk != -1 and bk != -1 and CHEBYSHEV_TABLE[wk][bk] > 1


def _tb_child_wdl_dtm(
    side_after: Color, wk2: int, wr2: int, bk2: int
) -> tuple[int, int]:
    """Return (wdl, dtm_byte) for the child TB state, or (0, 255) if TB missing."""
    global _KRK_TABLE, _KRK_DTM
    if not (_KRK_TABLE and _KRK_DTM):
        return (0, 255)
    idx = _krk_index(side_after, wk2, wr2, bk2)
    wdl, _, _ = _krk_unpack(_KRK_TABLE[idx])
    d = int(_KRK_DTM[idx])
    return (wdl, d)


def _build_chebyshev_table() -> Tuple[Tuple[int, ...], ...]:
    table: List[List[int]] = [[0] * BRD_SQ_NUM for _ in range(BRD_SQ_NUM)]
    for sq1 in range(BRD_SQ_NUM):
        f1 = FILE_INDEX[sq1]
        r1 = RANK_INDEX[sq1]
        for sq2 in range(BRD_SQ_NUM):
            table[sq1][sq2] = max(
                abs(f1 - FILE_INDEX[sq2]),
                abs(r1 - RANK_INDEX[sq2]),
            )
    return tuple(tuple(row) for row in table)


CHEBYSHEV_TABLE: Tuple[Tuple[int, ...], ...] = _build_chebyshev_table()
tablebase_repeat_tracker: Dict[int, int] = {}


def __init_zobrist_keys() -> Dict[object, int]:
    keys: Dict[object, int] = {}
    for sq in range(BRD_SQ_NUM):
        for piece in Pcs:
            if piece == Pcs.empty:
                continue
            keys[(sq, piece)] = random.getrandbits(64)
    keys["side"] = random.getrandbits(64)
    return keys


ZOBRIST_KEYS = __init_zobrist_keys()


def to_u64(value: int) -> U64:
    return U64(value & U64_MASK)


def compute_position_key(board: "Board") -> U64:
    key = 0
    for sq in range(BRD_SQ_NUM):
        piece = board.pieces[sq]
        if piece != Pcs.empty:
            key ^= ZOBRIST_KEYS[(sq, piece)]
    if board.side == Color.black:
        key ^= ZOBRIST_KEYS["side"]
    return to_u64(key)


def predict_position_key(board: "Board", from_sq: int, to_sq: int) -> U64:
    moved_piece = board.pieces[from_sq]
    captured_piece = board.pieces[to_sq]
    key = int(board.position_key)
    key ^= ZOBRIST_KEYS[(from_sq, moved_piece)]
    if captured_piece != Pcs.empty:
        key ^= ZOBRIST_KEYS[(to_sq, captured_piece)]
    key ^= ZOBRIST_KEYS[(to_sq, moved_piece)]
    key ^= ZOBRIST_KEYS["side"]
    return to_u64(key)


def file_rank_to_sq(piece_pos: str, color: Color) -> Tuple[Pcs, int]:
    piece, file, rank = [c for c in piece_pos]
    file_index = FILES.index(file)
    rank_index = int(rank) - 1
    sq64 = rank_index * 8 + file_index
    if color == Color.black:
        return Pcs[piece.lower()], sq64
    else:
        return Pcs[piece], sq64


def black_draw_capture_move(board) -> Optional[Tuple[int, int]]:
    for f, t, captured in generate_legal_moves(board, Color.black):
        if captured == Pcs.R:
            return (f, t)
    return None


@dataclass
class Undo:
    move: Tuple[int, int] = (-1, -1)
    position_key: U64 = U64(0)
    moved_piece: Pcs = Pcs.empty
    captured_piece: Pcs = Pcs.empty
    mover_bb: U64 = U64(0)
    captured_bb: Optional[U64] = None
    side: Color = Color.white
    ply: int = 0
    his_ply: int = 0
    occupied_white: U64 = U64(0)
    occupied_black: U64 = U64(0)
    occupied_both: U64 = U64(0)
    kings_pos: Tuple[int, int] = (-1, -1)
    rooks_pos: Tuple[int, int] = (-1, -1)
    new_position_key: U64 = U64(0)
    new_position_count_prev: int = 0


def generate_k_attack_bm(
    board: "Board",
    sq64: int,
    side: Color,
) -> U64:
    """Return king attack bitboard pruned by friendly occupancy."""

    attacks = KING_ATTACK_PATTERNS[sq64]
    friendly_occ = board.occupied[side.value]
    legal_attacks = to_u64(int(attacks) & ~int(friendly_occ))

    return to_u64(int(legal_attacks))


def build_king_attack_patterns() -> List[U64]:
    attacks: List[U64] = []
    for sq in range(64):
        bit = 1 << sq
        mask = 0
        mask |= (bit << 8) & U64_MASK
        mask |= (bit >> 8) & U64_MASK
        if bit & NOT_FILE_H:
            mask |= (bit << 9) & U64_MASK
            mask |= (bit >> 7) & U64_MASK
            mask |= (bit << 1) & U64_MASK
        if bit & NOT_FILE_A:
            mask |= (bit << 7) & U64_MASK
            mask |= (bit >> 9) & U64_MASK
            mask |= (bit >> 1) & U64_MASK
        attacks.append(U64(mask & U64_MASK))
    return attacks


KING_ATTACK_PATTERNS = build_king_attack_patterns()
KING_ATTACK_MASKS: Tuple[int, ...] = tuple(int(mask) for mask in KING_ATTACK_PATTERNS)


def build_rook_relevant_masks() -> Tuple[int, ...]:
    masks: List[int] = []
    for square in range(BRD_SQ_NUM):
        rank = square // 8
        file = square % 8
        mask = 0

        for r in range(rank + 1, 8):
            mask |= 1 << (r * 8 + file)
        for r in range(rank - 1, -1, -1):
            mask |= 1 << (r * 8 + file)
        for f in range(file + 1, 8):
            mask |= 1 << (rank * 8 + f)
        for f in range(file - 1, -1, -1):
            mask |= 1 << (rank * 8 + f)

        masks.append(mask & U64_MASK)

    return tuple(masks)


ROOK_RELEVANT_MASKS: Tuple[int, ...] = build_rook_relevant_masks()


@lru_cache(maxsize=4_096)
def _cached_rook_attacks(square: int, relevant_occ: int) -> int:
    attacks = 0
    rank = square // 8
    file = square % 8

    for r in range(rank + 1, 8):
        sq = r * 8 + file
        attacks |= 1 << sq
        if relevant_occ & (1 << sq):
            break

    for r in range(rank - 1, -1, -1):
        sq = r * 8 + file
        attacks |= 1 << sq
        if relevant_occ & (1 << sq):
            break

    for f in range(file + 1, 8):
        sq = rank * 8 + f
        attacks |= 1 << sq
        if relevant_occ & (1 << sq):
            break

    for f in range(file - 1, -1, -1):
        sq = rank * 8 + f
        attacks |= 1 << sq
        if relevant_occ & (1 << sq):
            break

    return attacks & U64_MASK


def rook_attacks_on_the_fly(square: int, occupancy: int) -> int:
    relevant_occ = occupancy & ROOK_RELEVANT_MASKS[square]
    return _cached_rook_attacks(square, relevant_occ)


def generate_rook_attack_bm(
    board: "Board",
    sq64: int,
    side: Color,
) -> U64:
    """Return rook attack bitboard pruned by friendly occupancy."""

    occupancy = int(board.occupied[BOTH_INDEX])
    friendly_occ = int(board.occupied[side.value])
    attacks = rook_attacks_on_the_fly(sq64, occupancy)
    legal_attacks = attacks & ~friendly_occ

    return to_u64(legal_attacks)


ATTACK_VECTORS: Tuple[Optional[Callable[["Board", int, Color], U64]], ...] = (
    None,
    generate_rook_attack_bm,
    generate_k_attack_bm,
    generate_rook_attack_bm,
    generate_k_attack_bm,
)


def is_check(board: "Board", side: Color, sq64: int) -> bool:
    """Return True when the king on sq64 is attacked by the opponent."""

    if sq64 < 0:
        return True

    opponent = Color.white if side == Color.black else Color.black
    occ = int(board.occupied[BOTH_INDEX]) & ~(1 << sq64)

    opponent_rooks = int(board.pieces_bb[opponent.value][ROOK_SLOT])
    if opponent_rooks:
        rook_mask = rook_attacks_on_the_fly(sq64, occ)
        if rook_mask & opponent_rooks:
            return True

    opponent_king_sq = board.kings_pos[opponent.value]
    if opponent_king_sq != -1:
        if KING_ATTACK_MASKS[opponent_king_sq] & (1 << sq64):
            return True

    return False


def is_repetition_with_move(
    board: "Board",
    move: Tuple[int, int],
    limit: int = 3,
    predicted_key: Optional[U64] = None,
) -> bool:
    from_sq, to_sq = move
    key = (
        predicted_key
        if predicted_key is not None
        else predict_position_key(board, from_sq, to_sq)
    )
    return board.history_counts.get(key, 0) + 1 >= limit


def position_to_fen(position: str, start_side: Union[Color, str]) -> str:
    """Given a position in "Kc4,Rf1 - Ka5" format, return FEN string."""
    white_part, black_part = position.split(" - ")
    board = ["1"] * 64

    for piece_pos in white_part.split(","):
        piece, file, rank = [c for c in piece_pos]
        file_index = FILES.index(file)
        rank_index = int(rank) - 1
        sq64 = rank_index * 8 + file_index
        board[sq64] = piece

    for piece_pos in black_part.split(","):
        piece, file, rank = [c for c in piece_pos]
        file_index = FILES.index(file)
        rank_index = int(rank) - 1
        sq64 = rank_index * 8 + file_index
        board[sq64] = piece.lower()

    fen_rows = []
    for rank in range(7, -1, -1):
        fen_row = ""
        empty_count = 0
        for file in range(8):
            sq64 = rank * 8 + file
            piece = board[sq64]
            if piece == "1":
                empty_count += 1
            else:
                if empty_count > 0:
                    fen_row += str(empty_count)
                    empty_count = 0
                fen_row += piece
        if empty_count > 0:
            fen_row += str(empty_count)
        fen_rows.append(fen_row)
    fen_position = "/".join(fen_rows)
    if isinstance(start_side, str):
        start_side = Color.white if start_side.lower() == "w" else Color.black
    fen_string = f"{fen_position} {start_side.name[0]} - - 0 1"
    return fen_string


def is_in_check(board: "Board", side: Color) -> bool:
    """Determine if the given side is in check."""

    king_sq = board.kings_pos[side.value]
    if king_sq == -1:
        return True
    return is_check(board, side, king_sq)


def _move_keeps_king_safe(
    side: Color,
    from_sq: int,
    to_sq: int,
    moved_piece: Pcs,
    captured_piece: Pcs,
    base_white_occ: int,
    base_black_occ: int,
    base_both_occ: int,
    own_king_sq: int,
    opponent_rooks: int,
    opponent_king_sq: int,
) -> bool:
    from_mask = 1 << from_sq
    to_mask = 1 << to_sq

    white_occ = base_white_occ
    black_occ = base_black_occ
    both_occ = base_both_occ

    if side == Color.white:
        white_occ &= ~from_mask
    else:
        black_occ &= ~from_mask
    both_occ &= ~from_mask

    if captured_piece != Pcs.empty:
        if captured_piece in WHITE_PIECES:
            white_occ &= ~to_mask
        else:
            black_occ &= ~to_mask
        both_occ &= ~to_mask

    if side == Color.white:
        white_occ |= to_mask
    else:
        black_occ |= to_mask
    both_occ |= to_mask

    king_sq = (
        to_sq
        if moved_piece == (Pcs.K if side == Color.white else Pcs.k)
        else own_king_sq
    )
    if king_sq == -1:
        return False

    opponent_rooks_after = opponent_rooks
    if captured_piece == (Pcs.r if side == Color.white else Pcs.R):
        opponent_rooks_after &= ~to_mask

    opponent_king_sq_after = opponent_king_sq
    if captured_piece == (Pcs.k if side == Color.white else Pcs.K):
        opponent_king_sq_after = -1

    if rook_attacks_on_the_fly(king_sq, both_occ) & opponent_rooks_after:
        return False

    if (
        opponent_king_sq_after != -1
        and (KING_ATTACK_MASKS[opponent_king_sq_after] & (1 << king_sq)) != 0
    ):
        return False

    return True


def generate_legal_moves(board: "Board", side: Color):
    side_idx = side.value
    opponent = Color.white if side == Color.black else Color.black
    opponent_idx = opponent.value
    piece_types = WHITE_PIECES if side == Color.white else BLACK_PIECES
    pieces = board.pieces
    base_white_occ = int(board.occupied[WHITE_INDEX])
    base_black_occ = int(board.occupied[BLACK_INDEX])
    base_both_occ = int(board.occupied[BOTH_INDEX])
    own_king_sq = board.kings_pos[side_idx]
    opponent_rooks = int(board.pieces_bb[opponent_idx][ROOK_SLOT])
    opponent_king_sq = board.kings_pos[opponent_idx]

    for piece_type in piece_types:
        slot = PIECE_SLOT[piece_type]
        attack_fn = ATTACK_VECTORS[piece_type.value]
        if attack_fn is None:
            continue
        piece_bb = int(board.pieces_bb[side_idx][slot])
        for from_sq in iter_bits(piece_bb):
            attack_bm = attack_fn(board, from_sq, side)
            for to_sq in iter_bits(int(attack_bm)):
                captured = pieces[to_sq]
                moved_piece = pieces[from_sq]
                if _move_keeps_king_safe(
                    side,
                    from_sq,
                    to_sq,
                    moved_piece,
                    captured,
                    base_white_occ,
                    base_black_occ,
                    base_both_occ,
                    own_king_sq,
                    opponent_rooks,
                    opponent_king_sq,
                ):
                    yield (from_sq, to_sq, captured)


def krk_tb_pick_two(board) -> list[tuple[tuple[int, int], int, int, U64]]:
    """
    Return up to two White moves [(move, dtm_child, rep_count, predicted_key)], both winning,
    Includes guard vs immediate rook capture and 1-ply lookahead to avoid next-turn repetition.
    """
    if (
        board.side != Color.white
        or not _is_valid_krk_position(board)
        or not (_KRK_TABLE and _KRK_DTM)
    ):
        return []

    wk = board.kings_pos[WHITE_INDEX]
    bk = board.kings_pos[BLACK_INDEX]
    wr = _white_rook_sq(board)
    if wr == -1:
        return []

    root_idx = _krk_index(Color.white, wk, wr, bk)
    root_dtm = int(_KRK_DTM[root_idx])

    strict_candidates: list[tuple[tuple[int, int], int, int, int, U64]] = []
    loose_candidates: list[tuple[tuple[int, int], int, int, int, U64]] = []

    for f, t, _ in generate_legal_moves(board, Color.white):
        undo_w = board.make_move(f, t, update_eval=False)
        try:
            wk2 = board.kings_pos[WHITE_INDEX]
            bk2 = board.kings_pos[BLACK_INDEX]
            wr2 = _white_rook_sq(board)
            if wk2 == -1 or bk2 == -1 or wr2 == -1:
                continue

            wdl_child, dtm_child = _tb_child_wdl_dtm(board.side, wk2, wr2, bk2)
            if wdl_child != 2:
                continue

            child_key = board.position_key
            rep_now = board.history_counts.get(child_key, 0)
            rep_next = 0
            black_can_capture = False
            history_counts = board.history_counts
            for bf, bt, bc in generate_legal_moves(board, Color.black):
                if bc == Pcs.R:
                    black_can_capture = True
                    break
                future_key = predict_position_key(board, bf, bt)
                future_count = history_counts.get(future_key, 0) + 1
                if future_count > rep_next:
                    rep_next = future_count

            if black_can_capture:
                continue

            item = ((f, t), dtm_child, rep_now, rep_next, child_key)
            if dtm_child == root_dtm - 1:
                strict_candidates.append(item)
            else:
                loose_candidates.append(item)
        finally:
            board.undo_move(undo_w)

    pool = strict_candidates if strict_candidates else loose_candidates
    if not pool:
        return []

    pool.sort(key=lambda x: (x[1], x[2], x[3]))

    top: list[tuple[tuple[int, int], int, int, U64]] = []
    seen_keys: set[int] = set()
    for (f, t), d, rep_now, _rep_next, child_key in pool:
        child_key_int = int(child_key)
        if child_key_int in seen_keys:
            continue
        seen_keys.add(child_key_int)
        top.append(((f, t), d, rep_now, child_key))
        if len(top) == 2:
            break

    return top


def generate_next_move(
    board: "Board",
    side: Color,
) -> Optional[Tuple[int, int]]:
    """Return the next move, preferring tablebase picks with repetition guards."""
    position_key = int(board.position_key)
    tb_usage = tablebase_repeat_tracker.get(position_key, 0)
    repetition_count = board.repetition_count()

    allow_tablebase = (
        tb_usage < TABLEBASE_REPEAT_THRESHOLD
        and repetition_count < TABLEBASE_REPEAT_THRESHOLD
    )

    if allow_tablebase:
        if side == Color.black:
            cap = black_draw_capture_move(board)
            if cap is not None:
                return cap
        candidates = krk_tb_pick_two(board)
        if candidates:
            for move, _dtm, _rep, predicted_key in candidates:
                if is_repetition_with_move(
                    board,
                    move,
                    limit=2,
                    predicted_key=predicted_key,
                ):
                    continue
                tablebase_repeat_tracker[position_key] = tb_usage + 1
                if len(tablebase_repeat_tracker) > TABLEBASE_TRACKER_MAX:
                    tablebase_repeat_tracker.clear()
                return move
            tablebase_repeat_tracker[position_key] = TABLEBASE_REPEAT_THRESHOLD
    else:
        if tb_usage >= TABLEBASE_REPEAT_THRESHOLD:
            tablebase_repeat_tracker[position_key] = min(
                TABLEBASE_REPEAT_THRESHOLD + 1, tb_usage + 1
            )
        else:
            tablebase_repeat_tracker[position_key] = TABLEBASE_REPEAT_THRESHOLD

    fallback_move: Optional[Tuple[int, int]] = None
    for from_sq, to_sq, _ in generate_legal_moves(board, side):
        move = (from_sq, to_sq)
        if fallback_move is None:
            fallback_move = move
        predicted_key = predict_position_key(board, from_sq, to_sq)
        if not is_repetition_with_move(
            board, move, limit=2, predicted_key=predicted_key
        ):
            return move

    return fallback_move


@dataclass
class Board:
    pieces: List[Pcs] = field(default_factory=lambda: [Pcs.empty] * BRD_SQ_NUM)
    side: Color = Color.white
    fifty_move: int = 0
    ply: int = 0
    his_ply: int = 0
    position_key: U64 = U64(0)
    pieces_bb: List[List[U64]] = field(default_factory=_empty_piece_bitboards)
    kings_pos: List[int] = field(default_factory=lambda: [-1, -1])
    rooks_pos: list[int] = field(
        default_factory=lambda: [-1, -1]
    )  # assume no promotions for now
    occupied: List[U64] = field(
        default_factory=lambda: [U64(0), U64(0), U64(0)]
    )  # also kept as a masked 64-bit
    history: Deque[U64] = field(default_factory=deque)
    history_counts: Dict[U64, int] = field(default_factory=dict)

    def move_to_algebraic(self, from_sq: int, to_sq: int) -> str:
        piece = self.pieces[from_sq]
        to_file = FILES[to_sq % 8]
        to_rank = str((to_sq // 8) + 1)
        return f"{piece.name}{to_file}{to_rank}"

    def algebraic_to_move(self, move_str: str, side=Color.black) -> Tuple[int, int]:
        piece = Pcs[move_str[0].lower() if side == Color.black else move_str[0]]
        to_file = move_str[1]
        to_rank = move_str[2]
        to_file_index = FILES.index(to_file)
        to_rank_index = int(to_rank) - 1
        to_sq64 = to_rank_index * 8 + to_file_index
        side_idx = side.value
        slot = PIECE_SLOT[piece]
        from_bb = int(self.pieces_bb[side_idx][slot])
        from_sq64 = next(iter_bits(from_bb), None)
        if from_sq64 is None:
            raise ValueError(f"No {piece.name} available to play {move_str}")
        return (from_sq64, to_sq64)

    def __post_init__(self):
        self.position_key = compute_position_key(self)
        self.history.append(self.position_key)
        self.history_counts = {self.position_key: 1}

    def has_legal_move(self, side: Optional[Color] = None) -> bool:
        side_to_check = side if side is not None else self.side
        for _ in generate_legal_moves(self, side_to_check):
            return True
        return False

    def repetition_count(self, key: Optional[U64] = None) -> int:
        target = key if key is not None else self.position_key
        return self.history_counts.get(target, 0)

    def is_terminal(self) -> bool:
        white_missing = self.kings_pos[WHITE_INDEX] == -1
        black_missing = self.kings_pos[BLACK_INDEX] == -1
        if white_missing or black_missing:
            return True

        return not self.has_legal_move(self.side)

    def make_move(self, from_sq: int, to_sq: int, update_eval: bool = True) -> Undo:
        moved_piece = self.pieces[from_sq]
        captured_piece = self.pieces[to_sq]
        mover_color = Color.white if moved_piece in WHITE_PIECES else Color.black
        opponent = Color.white if mover_color == Color.black else Color.black
        mover_idx = mover_color.value
        mover_slot = PIECE_SLOT[moved_piece]
        captured_color: Optional[Color] = None
        if captured_piece != Pcs.empty:
            captured_color = (
                Color.white if captured_piece in WHITE_PIECES else Color.black
            )
        captured_idx = captured_color.value if captured_color is not None else None
        captured_slot = (
            PIECE_SLOT[captured_piece] if captured_color is not None else None
        )

        undo = Undo(
            move=(from_sq, to_sq),
            position_key=self.position_key,
            moved_piece=moved_piece,
            captured_piece=captured_piece,
            mover_bb=self.pieces_bb[mover_idx][mover_slot],
            captured_bb=(
                self.pieces_bb[captured_idx][captured_slot]
                if captured_idx is not None and captured_slot is not None
                else None
            ),
            side=mover_color,
            ply=self.ply,
            his_ply=self.his_ply,
            occupied_white=self.occupied[WHITE_INDEX],
            occupied_black=self.occupied[BLACK_INDEX],
            occupied_both=self.occupied[BOTH_INDEX],
            kings_pos=(self.kings_pos[0], self.kings_pos[1]),
            rooks_pos=(
                self.rooks_pos[0],
                self.rooks_pos[1],
            ),
        )

        self.pieces[to_sq] = moved_piece
        self.pieces[from_sq] = Pcs.empty

        mover_bb = clear_bit(self.pieces_bb[mover_idx][mover_slot], from_sq)
        mover_bb = set_bit(mover_bb, to_sq)
        self.pieces_bb[mover_idx][mover_slot] = mover_bb

        if captured_idx is not None and captured_slot is not None:
            captured_bb = clear_bit(self.pieces_bb[captured_idx][captured_slot], to_sq)
            self.pieces_bb[captured_idx][captured_slot] = captured_bb

        self.occupied[mover_idx] = set_bit(
            clear_bit(self.occupied[mover_idx], from_sq),
            to_sq,
        )
        self.occupied[BOTH_INDEX] = set_bit(
            clear_bit(self.occupied[BOTH_INDEX], from_sq),
            to_sq,
        )
        if captured_idx is not None:
            self.occupied[captured_idx] = clear_bit(self.occupied[captured_idx], to_sq)

        if moved_piece == Pcs.K:
            self.kings_pos[WHITE_INDEX] = to_sq
        elif moved_piece == Pcs.k:
            self.kings_pos[BLACK_INDEX] = to_sq

        if captured_piece == Pcs.K:
            self.kings_pos[WHITE_INDEX] = -1
        elif captured_piece == Pcs.k:
            self.kings_pos[BLACK_INDEX] = -1

        if moved_piece == Pcs.R:
            for idx in range(0, 2):
                if self.rooks_pos[idx] == from_sq:
                    self.rooks_pos[idx] = to_sq
                    break

        if captured_piece == Pcs.R:
            for idx in range(0, 2):
                if self.rooks_pos[idx] == to_sq:
                    self.rooks_pos[idx] = -1
                    break

        key = int(self.position_key)
        key ^= ZOBRIST_KEYS[(from_sq, moved_piece)]
        if captured_piece != Pcs.empty:
            key ^= ZOBRIST_KEYS[(to_sq, captured_piece)]
        key ^= ZOBRIST_KEYS[(to_sq, moved_piece)]
        key ^= ZOBRIST_KEYS["side"]

        self.ply += 1
        self.his_ply += 1

        self.side = opponent

        new_key = to_u64(key)
        prev_count = self.history_counts.get(new_key, 0)
        undo.new_position_key = new_key
        undo.new_position_count_prev = prev_count

        self.position_key = new_key
        self.history.append(new_key)
        self.history_counts[new_key] = prev_count + 1

        return undo

    def undo_move(self, undo: Undo):
        from_sq, to_sq = undo.move
        opponent = Color.white if undo.side == Color.black else Color.black

        if self.history:
            self.history.pop()

        new_key = undo.new_position_key
        prev = undo.new_position_count_prev
        if prev == 0:
            self.history_counts.pop(new_key, None)
        else:
            self.history_counts[new_key] = prev

        self.side = undo.side
        self.position_key = undo.position_key
        self.ply = undo.ply
        self.his_ply = undo.his_ply

        self.pieces[from_sq] = undo.moved_piece
        self.pieces[to_sq] = undo.captured_piece

        side_idx = undo.side.value
        mover_slot = PIECE_SLOT[undo.moved_piece]
        self.pieces_bb[side_idx][mover_slot] = undo.mover_bb
        if undo.captured_piece != Pcs.empty and undo.captured_bb is not None:
            opponent_idx = opponent.value
            captured_slot = PIECE_SLOT[undo.captured_piece]
            self.pieces_bb[opponent_idx][captured_slot] = undo.captured_bb

        self.occupied[WHITE_INDEX] = undo.occupied_white
        self.occupied[BLACK_INDEX] = undo.occupied_black
        self.occupied[BOTH_INDEX] = undo.occupied_both

        self.kings_pos = [undo.kings_pos[0], undo.kings_pos[1]]
        self.rooks_pos = list(undo.rooks_pos)


def init_bitboards(board: Board):
    board.pieces_bb = _empty_piece_bitboards()
    board.occupied = [U64(0), U64(0), U64(0)]
    board.kings_pos = [-1, -1]
    board.rooks_pos = [-1, -1]

    for sq in range(BRD_SQ_NUM):
        piece = board.pieces[sq]
        if piece == Pcs.empty:
            continue

        if piece in WHITE_PIECES:
            color = Color.white
        elif piece in BLACK_PIECES:
            color = Color.black
        else:
            continue

        color_idx = color.value
        slot = PIECE_SLOT[piece]
        board.pieces_bb[color_idx][slot] = set_bit(board.pieces_bb[color_idx][slot], sq)
        board.occupied[BOTH_INDEX] = set_bit(board.occupied[BOTH_INDEX], sq)
        board.occupied[color_idx] = set_bit(board.occupied[color_idx], sq)

        if piece == Pcs.K:
            board.kings_pos[WHITE_INDEX] = sq
        elif piece == Pcs.k:
            board.kings_pos[BLACK_INDEX] = sq
        elif piece == Pcs.R:
            if board.rooks_pos[0] == -1:
                board.rooks_pos[0] = sq
            else:
                board.rooks_pos[1] = sq
    board.position_key = compute_position_key(board)
    board.history = deque([board.position_key])
    board.history_counts = {board.position_key: 1}


class WhitePlayer:
    def __init__(self, position):
        self.position = position
        self.list_of_pieces: List[Pcs] = [Pcs.empty] * BRD_SQ_NUM
        self.board: Board = Board()

        self.init_board()

    def init_board(self):
        self.list_of_pieces = self._parse_position()
        self.board = Board(pieces=self.list_of_pieces)
        init_bitboards(self.board)
        tablebase_repeat_tracker.clear()

    def _parse_position(self):
        list_of_pieces: List[Pcs] = [Pcs.empty] * BRD_SQ_NUM
        white, black = self.position.split(" - ")
        po_w, pt_w = [file_rank_to_sq(pos, Color.white) for pos in white.split(",")]
        b_one = file_rank_to_sq(black, Color.black)
        list_of_pieces[po_w[1]] = po_w[0]
        list_of_pieces[pt_w[1]] = pt_w[0]
        list_of_pieces[b_one[1]] = b_one[0]

        return list_of_pieces

    def play(self, black_move) -> str:
        try:
            algebraic = self.board.algebraic_to_move(black_move)
        except ValueError:
            print("No legal move available for", black_move)
            return "resign"
        self.board.make_move(*algebraic)
        move = generate_next_move(self.board, Color.white)
        if move is not None:
            move_in_algebraic = self.board.move_to_algebraic(*move)
            self.board.make_move(*move)
            return move_in_algebraic
        else:
            return "resign"


