import sys  # noqa: E402


def play_white_vs_stockfish(
    position: str,
    *,
    stockfish_path: str = "stockfish",
    stockfish_depth: Optional[int] = 15,
    stockfish_movetime: Optional[int] = None,
    max_plies: int = 200,
    verbose: bool = True,
):
    """Run a quick sparring game where our engine plays White versus Stockfish."""

    def sq_to_coord(sq: int) -> str:
        file_idx = sq % 8
        rank_idx = sq // 8
        return f"{FILES[file_idx]}{rank_idx + 1}"

    def coord_to_sq(coord: str) -> int:
        if len(coord) < 2:
            raise ValueError(f"Invalid coordinate: {coord}")
        file_idx = FILES.index(coord[0])
        rank_idx = int(coord[1]) - 1
        return rank_idx * 8 + file_idx

    try:
        from uci_adapter import UCIEngine
    except ImportError as error:
        raise RuntimeError("uci_adapter not available; cannot use Stockfish") from error

    white_player = WhitePlayer(position)
    initial_fen = position_to_fen(position, Color.white)
    moves: List[str] = []
    side_to_move = Color.white

    if verbose:
        print("Starting sparring game (White = our engine, Black = Stockfish)")
        print(f"Initial position: {position}")
        print(f"FEN: {initial_fen}")

    with UCIEngine(path=stockfish_path) as engine:
        engine.new_game()
        engine.set_position(startpos=False, fen=initial_fen)

        for ply in range(max_plies):
            if side_to_move == Color.white:
                move = generate_next_move(white_player.board, Color.white)
                if move is None:
                    if verbose:
                        print("Our engine has no legal move; stopping.")
                    break
                from_sq, to_sq = move
                coord_move = f"{sq_to_coord(from_sq)}{sq_to_coord(to_sq)}"
                moves.append(coord_move)
                if verbose:
                    print(
                        f"White plays {white_player.board.move_to_algebraic(from_sq, to_sq)}"
                        f" (coord {coord_move})"
                    )
                white_player.board.make_move(from_sq, to_sq)
                engine.set_position(startpos=False, fen=initial_fen, moves=moves)
                if white_player.board.is_terminal():
                    if verbose:
                        print("Game ended after our move.")
                    break
                side_to_move = Color.black
            else:
                result = engine.go(
                    depth=stockfish_depth if stockfish_depth is not None else None,
                    movetime=stockfish_movetime,
                )
                bestmove = result.bestmove
                if bestmove is None:
                    if verbose:
                        print("Stockfish reported no move; stopping.")
                    break
                move_str = bestmove[:4]
                from_sq = coord_to_sq(move_str[:2])
                to_sq = coord_to_sq(move_str[2:])
                moves.append(move_str)
                if verbose:
                    print(f"Stockfish plays {move_str}")
                white_player.board.make_move(from_sq, to_sq)
                engine.set_position(startpos=False, fen=initial_fen, moves=moves)
                if white_player.board.is_terminal():
                    if verbose:
                        print("Game ended after Stockfish's move.")
                    break
                side_to_move = Color.white

    outcome = {
        "moves": moves,
        "game_moves": len(moves) // 2,
        "plies": len(moves),
        "black_in_check": is_in_check(white_player.board, Color.black),
        "white_in_check": is_in_check(white_player.board, Color.white),
    }
    print("Outcome:", outcome)
    return outcome


